import React from "react";
import "../CSS/Layout.css";


function Layout() {
  return (
    <div className="layout">
      <div className="overlay">
        <div className="Content">
          <div className="text">
            <p>
              <h1>Omar Shalaby</h1>
            </p>
            <p className="web">
              <h4>Full-Stack web</h4>
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Layout;
